    <div class=\"container-fluid\">
        {% include 'profil/civilite.html.twig' %} 

        {% block OF %}
        {% endblock OF %} 
    
       {% block Formateur %}
        {% endblock Formateur %} 

        {% block MA %}
        {% endblock MA %}

        {% block ENT %}
        {% endblock ENT %}

        <div class=\"row\">
            <div class=\"col-6\">    
                <h3>Mes documents :</h3>
                <label for=\"listDoc\">Chercher un document :</label>
                <input list=\"documents\" type=\"text\" id=\"listDoc\">
                <datalist id=\"documents\">
                    {% for doc in document %}
                        <option id=\"{{doc.d_id}}\" value=\"{{doc.d_titre}}\">{{doc.d_fileName}}</option>
                    {% endfor %}
                </datalist>
            </div>
            <div class=\"col-4 mt-5\">
                <button onclick='seeDoc2({{id}})' class=\"mt-4\">
